import React from 'react';
import '../styles/highlight.css'

export default function Highlight(probs) {    
    return (
    <div className="highlight">
        <div>
    <h3>Digitale Übersicht</h3>
    <h4 > {probs.überschrift}</h4>
    <p >{probs.text}</p>
        {probs.hichart1}
    </div>  
    </div>
    );
}
